import Vue from 'vue'
import VueForm from 'vue-form'

var options = {
    validators: {
        'no-espacios' : function(value) {
            return !value.includes(' ')
            //return /[^ ]+/.test(value)
        }
    }
}

Vue.use(VueForm, options)
